/* *****************************************************************************
In charge of producing data to train the model for SocGen

To extract image urls from keyboard of SocGen : run the following script in
the console of the login web page of SocGen (this is the same script as in bank.service.ts / SocGen) :

Note : images are always identical so their Hash should be enough, BUT : when the browser downloads
the keyboard image, then the canvas is the only way to get the raw data (dataurl). And this method
returns differents results on different browsers. This difference is enven used to finger print
browsers... That's why we have to ocr images for SocGen...

*****************************************************************************


// get the keyboard image
const keyboardEl = document.querySelector("#img_clavier");
const img = new Image()
img.src = keyboardEl.src;
const promise = new Promise((resolve)=>{
  img.onload = resolve
})
await promise;

//* Image geometry
const
  X0 = 4,
  Y0 = 4,
  Dx = 15,
  Dy = 10,
  STEP_X = 64-X0,
  STEP_Y = 64-Y0,
  IMG_W = 55-2*Dx-X0+1,
  IMG_H = 55-2*Dy-Y0+1;

//* canvas
const canvasForKeys = document.createElement("canvas");
canvasForKeys.width = 22;
canvasForKeys.height = 32;
const ctxForKeys = canvasForKeys.getContext('2d');

//* ************************************************************************
//* the keyboard is a single image, we have to split it into an image
//* for each key and run ocr
//* ************************************************************************
const dataUrls = [];
for (let j = 0; j < 4; j++) {
  for (let i = 0; i < 4; i++) {
    const x = X0 + i * STEP_X + Dx;
    const y = Y0 + j * STEP_Y + Dy;
    ctxForKeys.drawImage(img, x, y, IMG_W, IMG_H, 0, 0, 22, 32) // all key images must be 22*32 to be ocr-ized
    dataUrls.push(canvasForKeys.toDataURL())
  }
}
console.log("\ndataUrls");
console.log(dataUrls);

***************************************************************************** */


